import React, {Component} from 'react';

import {quizzes, users} from './examples';
import {HTTP_SERVER_PORT_PICTURES} from './constants.js';



class App extends Component {

  constructor(props) {
    super(props)
    this.state = {
      toggle: false
    }
  }

    render() {
      return (
        <div id="navigation-mobile-wrapper">
          <button
            className="home"
            onClick={
              () => this.setState({
                toggle: toggle ? false : false
              })
            }
          >
            <img src="img/menu-closed.svg" alt="Menu" />
          </button>
          <button className=
          { this.state.toggle ? "link left" : "link" }>A</button>
          <button className="link top">B</button>
          <button className="link right">C</button>
          <nav id="navigation-mobile">

            <section className="left">
            </section>

            <section className="center">
            </section>

            <section className="right">
              <button>
                <img src="img/search.svg" alt="Search" />
              </button>
            </section>

          </nav>
        </div>
      );
    }
}

export default App;
